			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\nset -euo pipefail\n\necho \"[Hermes dSYM fix] Searching for hermes.framework and matching dSYM…\"\n\n# Where Xcode collects dSYMs during Archive\nDEST=\"${DWARF_DSYM_FOLDER_PATH}\"\n\n# Where outputs are built for this configuration\nAPP_CFG_DIR=\"${CONFIGURATION_BUILD_DIR}\"\nPODS_CFG_DIR=\"${PODS_CONFIGURATION_BUILD_DIR:-}\"\n\n# Likely places Hermes dSYM shows up (varies by RN/Pods)\nCANDIDATE_DSYMS=(\n  \"${APP_CFG_DIR}/hermes.framework.dSYM\"\n  \"${PODS_CFG_DIR}/hermes-engine/hermes.framework.dSYM\"\n  \"${PODS_ROOT}/../../build/hermes-framework/hermes.framework.dSYM\"\n)\n\n# Find the actual Hermes framework binary used in this build\nCANDIDATE_FWKS=(\n  \"${APP_CFG_DIR}/hermes.framework\"\n  \"${PODS_CFG_DIR}/hermes-engine/hermes.framework\"\n)\n\nFOUND_DSYM=\"\"\nFOUND_MATCH=\"\"\n\n# Get the UUID of the hermes binary we actually linked\nFWK_UUIDS=\"\"\nfor f in \"${CANDIDATE_FWKS[@]}\"; do\n  if [ -d \"$f\" ]; then\n    if [ -f \"$f/hermes\" ]; then\n      FWK_UUIDS=$(dwarfdump -uuid \"$f/hermes\" | awk '{print $2}')\n      echo \"Found hermes.framework at: $f\"\n      echo \"Binary UUID(s): $FWK_UUIDS\"\n      break\n    fi\n  fi\ndone\n\nif [ -z \"$FWK_UUIDS\" ]; then\n  echo \"Warning: Could not locate hermes.framework binary to derive UUID. Continuing.\"\nfi\n\n# Look for a dSYM whose UUID matches the framework binary UUID\nfor d in \"${CANDIDATE_DSYMS[@]}\"; do\n  if [ -d \"$d\" ]; then\n    DSYM_UUIDS=$(dwarfdump -uuid \"$d\" | awk '{print $2}')\n    echo \"Candidate dSYM: $d\"\n    echo \"dSYM UUID(s): $DSYM_UUIDS\"\n    for u in $DSYM_UUIDS; do\n      for fwu in $FWK_UUIDS; do\n        if [ \"$u\" = \"$fwu\" ]; then\n          FOUND_DSYM=\"$d\"\n          FOUND_MATCH=\"$u\"\n        fi\n      done\n    done\n  fi\ndone\n\nmkdir -p \"$DEST\"\n\nif [ -n \"$FOUND_DSYM\" ]; then\n  echo \"Copying matching Hermes dSYM (UUID $FOUND_MATCH) to: $DEST\"\n  cp -R \"$FOUND_DSYM\" \"$DEST\"\nelse\n  echo \"Warning: No matching Hermes dSYM found; archive may fail validation.\"\nfi\n";
		};
